import React from "react";
import './Sidebar.scss';
type SidebarProps = {
  title: string
}

const Sidebar = ({ title }: SidebarProps) => {

  return (
    <>
      <div className="sidebar">
        <p>{title}</p>
      </div>
    </>
  )
}

export default Sidebar;
